import React from "react";
import "./errorwindow.styles.css";

export const ErrorWindow = ({ errList }) => {
  return (
    <div className="error-window" id="err-wdw">
      <span className="err-msg">List of Errors</span>
      <div className="error-list">errList.map()</div>
    </div>
  );
};
